body:
По пункту 1
Заголовок: Hello
Текст: Congratulations, you made it!

По пункту 2
Насколько я помню, фокус программы в том, что строки лежат не в
константах, а на стеке, поэтому код для инициализации будет такой:

int main() {
    char caption[] = "Hello";
    char text[] = "Congratulations, you made it!";
    messageBox(......);
}
Проверено на компиляторе IAR ARM 8.32.1 такая инициализация кладет
строки на стек.

Если такой вариант инициализации вдруг не положит строки на стек, то
такой точно положит:
char caption[] = {'H','e','l','l','o','\0'};

Я это задание пару месяцев назад выполнял, но 15 тысяч мне так и не заплатили.

я придумал как код сильно ужать, чтобы запарно не добавлять функции:

    typedef decltype(StrToInt64ExA) *PStrToInt64ExA;
    PStrStrA StrStrA()
    {
      return PStrStrA(getProcAddress(_STR("StrStrA")));
    }
вызываем StrStrA()(....)
